import React, {Fragment} from 'react';
import styled from 'styled-components'


class LibrarySection extends React.Component {
    render() {
        const Title = styled.h1`
            font-size: 1.5em;
            color: palevioletred;
        `;
        return(
            <Fragment>
                <Title>Hello World!</Title>
            </Fragment>
        );
    }
}

export default LibrarySection;
